import React from "react";
import "./resume.css";
export const Resume = () => {
  const data = [
    {
      label: "Education",
      value: "education",
      desc: <Tabs />,
    },
    {
      label: "Professional Skills",
      value: "Professional Skills",
      desc: `Because it's about motivating the doers. Because I'm here
      to follow my dreams and inspire other people to follow their dreams, too.`,
    },
    {
      label: "More",
      value: "More",
      desc: `We're not always in the position that we want to be at.
      We're constantly growing. We're constantly making mistakes. We're
      constantly trying to express ourselves and actualize our dreams.`,
    },
  ];

  const [activeTab, setActiveTab] = React.useState("education");

  return (
    <section className="pb-12 pt-20 portfolio dark:bg-dark lg:pb-[90px] lg:pt-[120px] ">
      <div className="container mx-auto max-w-7xl px-2 sm:px-6 lg:px-8">
        <div className="-mx-4 flex  flex-wrap">
          <div className="w-full px-4">
            <div className=" mb-12 text-center mx-auto max-w-[510px] item-center lg:mb-20 ">
              <span className="mb-2 block text-lg font-semibold portfolio-name">
                3+ Years Experience
              </span>
              <h2 className="text-5xl portfolio-text">My Resume</h2>
            </div>
          </div>
        </div>
      </div>
      {/* <!-- component --> */}

      <div className="w-full container mx-auto max-w-7xl px-2 sm:px-6 lg:px-8">
        <div className="flex mb-4 items-center justify-center ">
          {data.map(({ label, value }) => (
            <button
              key={value}
              className={`bg-gradient-to-r from-blue-gray-100 to-white shadow-md px-4 py-2 mr-2 font-medium text-[#FF004F]-900 focus:outline-none ${
                activeTab === value
                  ? "custom-background"
                  : "hover:text-[#FF004F]"
              }`}
              style={{ width: "400px", height: "80px" }}
              onClick={() => setActiveTab(value)}
            >
              {label}
            </button>
          ))}
        </div>
        <div className="border-t">
          {data.map(({ value, desc }) =>
            activeTab === value ? (
              <div key={value} className="p-4">
                <p className="text-gray-700">{desc}</p>
              </div>
            ) : null
          )}
        </div>
      </div>
    </section>
  );
};

const Tabs = () => {
  return (
    <>
      <div className="container  mx-auto w-full h-full">
        <h1 className="education">Education quality</h1>
        <div className="relative flex overflow-hidden p-10 ">
          {/* First timeline item */}
          <div className="mb-8 ">
            {/* Btech  */}
            <div className="order-1 bg-gray-400 rounded-lg shadow-xl  px-6 py-4 resume-card ">
              <div className="flex">
                <div className="eduction_score_1">
                  <h3 className="mb-2 font-bold text-gray-800 text-xl">
                    B.Tech in Electronics and Communication Engineering.
                  </h3>
                  <p className="mb-3">From Geethanjali college(2016-20)</p>
                </div>
                <div className="flex items-center">
                  <button className="score rounded-lg font-bold">6.7/10</button>
                </div>
              </div>
              <div className="w-[350px] h-[2px] bg-gray-200 mb-3 "></div>
              <div className="text-md leading-snug tracking-wide text-gray-800 text-opacity-100">
                The training provided by universities in order to prepare people
                to work in various sectors of the economy or areas of culture.
              </div>
            </div>
          </div>
          <div className="flex justify-center items-center">
            <div className="flex flex-col items-center">
              <div className="w-[2px] h-[100px] bg-gray-800 mb-3"></div>
              <div className="w-[350px] h-[2px] bg-gray-200"></div>
            </div>
            <div className="w-[2px] h-[100px] bg-gray-600 mx-3"></div>
            <div className="flex flex-col items-center">
              <div className="w-[2px] h-[100px] bg-gray-500 mb-3"></div>
              <div className="w-[350px] h-[2px] bg-gray-400"></div>
            </div>
          </div>

          {/* 
          <div
            className="border-2-2 absolute border-opacity-20 border-gray-700 h-full border"
            style={{ right: "41%", top: "200px" }}
          ></div>
          <div className="order-1 w-5/12"></div>
          <div className="z-20 flex items-center order-1 bg-gray-800 shadow-xl w-8 h-8 rounded-full">
            {" "}
            <h1 className="mx-auto font-semibold text-lg text-white">.</h1>
          </div> */}
          {/* Second timeline item */}
          {/* <div className="mb-8 flex-initial w-32"> */}
          {/* <div className="order-1 w-5/12"></div> */}
          {/* <div className="z-20 flex items-center order-1 bg-gray-800 shadow-xl w-8 h-8 rounded-full"> */}
          {/* <h1 className="mx-auto text-white font-semibold text-lg">.</h1> */}
          {/* </div> */}
          {/* <div className="order-1 bg-red-400 rounded-lg shadow-xl w-[150px] h-[300px] px-6 py-4">
              <h3 className="mb-3 font-bold text-white text-xl">Lorem Ipsum</h3>
              <p className="text-sm font-medium leading-snug tracking-wide text-white text-opacity-100">
                Lorem Ipsum is simply dummy text of the printing and typesetting
                industry. Lorem Ipsum has been the industry's standard dummy
                text ever since the 1500s, when an unknown printer took a galley
                of type and scrambled it to make a type specimen book.
              </p>
            </div>
          </div> */}

          {/* Third timeline item */}
          {/* <div className="mb-8 "> */}
          {/* <div className="order-1 w-5/12"></div>
            <div className="z-20 flex items-center order-1 bg-gray-800 shadow-xl w-8 h-8 rounded-full"> */}
          {/* <h1 className="mx-auto font-semibold text-lg text-white">.</h1> */}
          {/* </div> */}
          {/* <div className="order-1 bg-gray-400 rounded-lg shadow-xl w-5/12 px-6 py-4">
              <h3 className="mb-3 font-bold text-gray-800 text-xl">
                Lorem Ipsum
              </h3>
              <p className="text-sm leading-snug tracking-wide text-gray-900 text-opacity-100">
                Lorem Ipsum is simply dummy text of the printing and typesetting
                industry. Lorem Ipsum has been the industry's standard dummy
                text ever since the 1500s, when an unknown printer took a galley
                of type and scrambled it to make a type specimen book.
              </p>
            </div>
          </div> */}
        </div>
      </div>
    </>
  );
};
